script: |
  super -f text -I q3935.spq | sort > q3935.out

inputs:
  - name: q3935.spq
    data: |
      SELECT - col2 FROM tab1 (FORMAT parquet) WHERE col1 IN ( col1 + + tab1.col0 + col1 / tab1.col0 ) AND NOT ( - col2 ) BETWEEN NULL AND NULL;
  - name: tab1

outputs:
  - name: q3935.out
    data: |
